    const [animals, setAnimals] = useState([]);
    
    useEffect(() => {
    Axios.get("http://localhost:3001/adopt").then((response) => {
    setAnimals(response.data)})}, [])

  return (
    <div>
        {
        animals.map((animal, index) => (
            <div>
            <h1>hello</h1>
            <AnimalCard key={index}/></div>)
        )}
        
    </div>
  )
}

export default Adopt;
